window.bookSummaryJSON = "<p><b>From number one best-selling and </b><b><i>USA Today</i></b><b> best-selling author Jack Mars, author of the critically acclaimed </b><b><i>Luke Stone</i></b><b> and </b><b><i>Agent Zero</i></b><b> series (with over 5,000 five-star reviews), comes an explosive new action-packed espionage series that takes listeners on a wild ride across Europe, America, and the world.</b></p> <p>Jacob Snow—elite soldier-turned-CIA agent, haunted by his tortured past—is one of the CIA’s greatest assets. When a terrorist group sets its eyes on the greatest archeological treasure of the holiest city, Jacob, dispatched, knows he has little time to reach Jerusalem before it sparks an international war.</p> <p>Jacob knows, even more, that he cannot solve the case without partnering with the mysterious archeologist he hopes to <i>not</i> fall in love with.</p> <p>As they spring into action to decode the ancient riddles and stop them, they soon realize the plot goes deeper than they could have imagined. With the fate of the world in the balance, they may just be out of time.</p> <p>An unputdownable action thriller with heart-pounding suspense and unforeseen twists, <i>Target Two</i> is the debut novel in an exhilarating new series by a number one best-selling author that will make you fall in love with a brand-new action hero—and keep you listening late into the night. Perfect for fans of Dan Brown, Daniel Silva, and Jack Carr.</p> <p>Books 3-6 in the series are now also available.</p>"; 
